import React from 'react';
import './Home.scss';


function ShowHeader() {
  const menulist = [
    {name:"Home",id:"#"},
    {name:"Shop",id:"#shop"},
    {name:"Cart",id:"#cart"},
    {name:"Log in",id:"#login"},
  ];
  return (
    <div className="header_content">
      {menulist.map(item => (
        <span className="smallfont">
          <a href={item.id}>{item.name}</a>
        </span>
      ))}
    </div>
  );
}

function Home() {
  return (
    <div className="home_parent">

      <div className="header">
        <ShowHeader />
      </div>

      <div className="home">

      </div>
    </div>
  )
}

export default Home;


